import React from 'react'
function MainWelcomePage(props = {}){

return (<div>Welcome To ObjectLand, {props.user && props.user.name || ''}.</div>)
}
MainWelcomePage.getInitialProps = async ({ req }) => {
    return {req: req}
  }
export default MainWelcomePage
